import Promotion from "../components/promotions/promotion";

export default function Promotions() {
  //get list of promotions active at the restaurant that's logged in, via an API call
  const example = {
    title: "Example promotion",
    description: "All items 40% off",
    category: 'Burgers',
    priceReduction: '40'
  };
  const example2 = {
    title: "Example promotion 2",
    description: "All items 40% off",
    category: 'Burgers',
    priceReduction: '40'
  };

  return (
    //iterate through list of promotions, render each as a promotion component
    <div>
      <h1>Current promotions:</h1>
      <Promotion data={example}></Promotion>
      <Promotion data={example2}></Promotion>
    </div>
  );
}
